	<>
	<h1 clssName="header" contentEditable="true">My name is {name}</h1>
	<img src={img1} alt="there is supposed to be a image" />
	<img src={img2} alt="there is supposed to be a image" />
	<img src={img3} alt="there is supposed to be a image" />
	<a href={link}><img src={img4} alt="there is supposed to be a image" /></a>
